import React from 'react';

const ResultCard = ({ userData }) => {
    return userData && (
        <div className='result_card'>
            <img style={{ width: '100px', height: '100px' }} src={userData.avatar_url} alt="" />
        </div>
    );
}

export default ResultCard;
